import calendar from "../img/calendar.jpg";
import Title from '../Title.js'

const Calendar = () => {
    return (
        <div class='calendar'>
            <Title name={"Calendar"}/>
            <div className='calendar-img-container'>
                <img src={calendar} className="calendar-image" alt="Calendar placeholder"/>
            </div>
        </div> 
    )
}

export default Calendar;
